def to_string(input_variables, encrypted=True):
    if type(input_variables) == dict:

        header = ""
        body = ""

        if not 'version' in input_variables:
            raise KeyError

        header += 'version=' + str(input_variables.get('version')) + '\n'

        for instance in input_variables:

            if not instance == 'version':
                body += instance + '=' + str(input_variables.get(instance)) + '\n'

        return header + body


def img_to_string(imagePath):
    with open(imagePath, 'rb') as imageFile:
        return str(base64.b64encode(imageFile.read()))

    raise IOError


def string_to_img(string, fileType):
    with open('output.' + fileType, 'wb') as file:
        file.write(base64.b64decode(string))

        return file

    raise IOError


